import React from 'react';

import './App.css';
import AppAtlas from './atlas_comps/appAtlas';
import AppMap from './atlas_comps/appMap';
import Exchange from './atlas_comps/exchange';

function App() {
  return (
    <div className="App">
      <Exchange/>
      <hr/>
     <AppAtlas/>
    </div>
  );
}

export default App;
